'use client';

import { useState, PropsWithChildren } from 'react';
import { FaBars, FaTimes } from 'react-icons/fa';

import CvFab from '@/app/components/CvFab';
import Sidebar from '@/app/components/Sidebar';
import '@/app/styles/theme.css';
import '@/app/styles/portfolio.css';
const CV_BASE64 = 'data:application/pdf;base64,'; 

export default function PortfolioLayout({ children }: PropsWithChildren) {
  const [open, setOpen] = useState(false);

  return (
    <>
      {/* Botn hamburguesa (solo mvil) */}
      <button
        type="button"
        className="pf-hamburger"
        aria-label={open ? 'Cerrar men' : 'Abrir men'}
        aria-expanded={open}
        onClick={() => setOpen(v => !v)}
      >
        {open ? <FaTimes aria-hidden /> : <FaBars aria-hidden />}
      </button>

      {/* Overlay mvil */}
      <div className={`pf-overlay ${open ? 'is-on' : ''}`} onClick={() => setOpen(false)} />

      <section className={`pf ${open ? 'pf--menuOpen' : ''}`}>
        <Sidebar open={open} onClose={() => setOpen(false)} />
        <main className="pf-main">{children}</main>
      </section>
         <CvFab
        dataBase64={CV_BASE64}
        filename="Leonardo_Burbano_CV.pdf"
        label="Descargar CV"
      />
    </>
  );
}
